webpackJsonp([56917902510408],{793:function(n,a){n.exports={data:{markdownRemark:{frontmatter:{title:"NEL'ZYA MORGAT'",type:"lyrics"},html:"<h1>NEL'ZYA MORGAT'</h1>\n<section>\n<p>Kuda ni gljan',<br>\nodna polyn'.<br>\nKak budto jan'<br>\nvpitala in'.</p>\n<p>Kuda ni gljan',<br>\nodin i tot<br>\nzhe son — i ja<br>\nna nem zatjort<br>\nsmeshnym den'kom,<br>\ngde vse pojut<br>\npro chudnyj dom<br>\ni pro sem'ju.<br>\nA ja? Chto ja?<br>\nKuda mne vstat'?<br>\nNa zadnij rjad?<br>\nNel'zja morgat'.<br>\nNel'zja morgat'.<br>\nNel'zja morgat'.<br>\nNe zagorazhivat'<br>\nljudej.</p>\n<p>Nel'zja morgat'.<br>\nNel'zja morgat'.<br>\nSmotret' pered soboj<br>\ni pet'<br>\npro chudnyj dom<br>\ni pro sem'ju,<br>\nv kotoroj ja<br>\nne poseljus'.<br>\nStojat' v rjadu,<br>\nsmotret' prjamej — <br>\nvse vspyshku zhdut,<br>\na chto za nej?<br>\nA kto iz nas ostanetsja?<br>\nNel'zja morgat'.<br>\nNel'zja morgat'.<br>\nNel'zja izbavit'sja.</p>\n<p>Nel'zja morgat'.<br>\nNel'zja morgat'.<br>\nStoju obezoruzhennyj.<br>\nKuda ni gljan',<br>\nvsjo budet tak,<br>\nkak budto by zasluzheno.<br>\nNel'zja morgat'.<br>\nNel'zja morgat'.<br>\nNel'zja izbavit'sja.<br>\nVsjo budet tak.<br>\nVsjo budet tak,<br>\nkak budto jeto nravitsja.</p>\n<p>Suhaja tkan'<br>\nbystree glaz<br>\nvpitaet nas.<br>\nVpitaet nas.</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/nelzyaMorgat/"}}}});
